import firstDog from "./img-react/dog-1.jpeg";
import secondDog from "./img-react/dog-2.jpeg";
import thirdDog from "./img-react/dog-3.jpeg";
function Blogs(props) {
  return (
    <div className="blogBoxes">
      <div className="box box-1">
        <img src={props.img} alt="firstDog" height="300px" width="325px" />
        <h6>{props.date}</h6>
        <h4 className="blog-headings">{props.heading}</h4>
        <button className="blog-btn">Read more</button>
      </div>
    </div>
  );
}
function App() {
  return (
    <div className="blogBoxes">
      <Blogs
        img={firstDog}
        date="24 Jan 2024"
        heading=<div>
          Finding your perfect <br /> dog breed
        </div>
      />
      <Blogs
        img={secondDog}
        date="23 Jan 2024"
        heading=<div>
          5 signs that it's time to <br /> change your dog's diet
        </div>
      />
      <Blogs
        img={thirdDog}
        date="21 Jan 2024"
        heading=<div>
          Taking care of your <br /> dog's joints
        </div>
      />
    </div>
  );
}

export default App;
